import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the video items to load
    await page.waitForSelector('.video-item');

    // Extract titles from the first 5 video items
    const videoTitles = await page.evaluate(() => {
      return Array.from(document.querySelectorAll('.video-item:nth-child(-n+5) .video-title'))
        .map(video => video.textContent.trim());
    });

    // Log the extracted titles
    console.log(videoTitles);

    // Take a screenshot after extracting titles
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_titles_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_titles_extracted.png'));

    return {
      success: true,
      action: "Extracted titles from the first 5 videos on the homepage",
      extractedData: { videoTitles },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

